{
    constructor(ph,pos){
        this.child=[]
        this.ph=ph
        this.ph0=ph
        this.pos=pos
        this.ore=-1
        this.people=-1
        this.panic = 0
        this.know = 0
    }
    findchild(next){
        for(var i = 0; i < 8; i++){
            if(next[i] != null){
                if(next[i].ph0 < 0)
                    next[i] = null
            }
            this.child.push(next[i])
        }
    }
    setpeople(id){
        this.people=id
        this.ph=-1
    }
    nextstep(){
        let m = Infinity
        let n = 8
        let next = this.pos
        for(var i=0;i<8;i++){
            if(this.child[i] && this.child[i].ph >= 0){
                if(this.child[i].ph0 < m){
                    m = this.child[i].ph0
                    n = i
                    next = this.child[n].pos
                }else if(this.child[i].ph0 == m){
                    n = i % 2 > n % 2 ? i : n
                    next = this.child[n].pos
                }

            }
        }
        if(m == 0){
            this.people=-1
            this.ph=this.ph0
        }
        else if(n < 8){
            this.child[n].setpeople(this.id)
            this.child[n].ore = n
            this.people=-1
            this.ph=this.ph0
        } 
        return [n, this.ph0, next[0], next[1], -3]
    }
